import React from "react";
import course1 from "../assets/course.jpg";
const Card = (image, date, course, fee) => {
  return (
    <div className="flex flex-col p-5 gap-5 m-5 w-[30rem] h-[28rem] rounded-xl shadow-lg  duration-500 border-2 border-indigo-700 leading-loose">
      <div>
        {/* image section  */}
        <img
          src={course1}
          alt="Sanjay Kandula"
          className="transition-transform hover:scale-110"
        />
      </div>

      <div className="flex gap-2 leading-loose">
        <h1 className="font-semibold text-xs flex flex-col">18 Mar, 2024</h1>
        <h1 className="font-semibold text-xs flex flex-col">Curriculum</h1>
      </div>

      <div>
        <h1 className="font-semibold text-xs flex flex-col">Students</h1>
      </div>

      <div>
        <p className="font-bold text-xl text-start hover:text-indigo-700">
          MERN Stack Development
        </p>
      </div>

      <div className="w-full shadow-lg font-bold h-1 bg-gray-300"></div>
      <div>
        <h1 className="text-orange-400 font-bold text-xl">$40</h1>
      </div>
    </div>
  );
};

export default Card;
